    false,nt"url": null,nt"notes": "The Salt Marsh Integrity (SMI) project
    involves monitoring several salt marsh metrics such as: historical condition and
    geomorphic setting; ditch density; surrounding land use; ratio of open water area
    to vegetation area; rate of pesticide application; environmental contaminant concentration;
    change in marsh surface elevation relative to sea level rise; tidal range and groundwater
    level; surface topography; salinity; and species composition and abundance of vegetation,
    invasive species, invertebrates, nekton, and breeding birds.  The attached products
    include data from salt marsh breeding bird and vegetation surveys.",nt"license_title":
